    const [books, setBooks] = useState([])
    useEffect(() => {
        fetch('https://book-swap-api.dev.io-academy.uk/api/books?climed=0')
            .then(res => res.json())
            .then(bookData => {
                setBooks(bookData.data)

            })
    }, [])

return (
     <BookCard books={books}/>
  )
}

